pragma solidity ^0.8.14;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract CookieCapital is ERC20 {
    address private _stakedToken;

    mapping (address => uint) private _stakes;
    mapping (address => uint) private _cookiePower;
    mapping (address => uint) private _stakeStartTimes;

    ERC20 private _token;

    event Staked(address indexed staker, uint256 amount);
    event Unstaked(address indexed staker, uint256 amount);
    event Harvest(address indexed spender, uint256 amount);
    event EatCookies(address indexed spender, uint256 amount);

    constructor (address stakedTokenAddress) ERC20("Cookies", "COK") {
        _token = ERC20(stakedTokenAddress);
    }

    function stake(uint256 amount) public {
        require(amount >= 10**18, "You need to stake at least 1 yvToken");
        if (_stakes[msg.sender] > 0) {
            unstake();
        }
        _token.transferFrom(msg.sender, address(this), amount);
        _stakes[msg.sender] = amount;
        _stakeStartTimes[msg.sender] = block.timestamp;
        emit Staked(msg.sender, amount);
    }

    function unstake() public {
        require(_stakes[msg.sender] > 0, "You haven't staked anything");
        harvest();
        uint256 stakes = _stakes[msg.sender];
        _stakes[msg.sender] = 0;
        _token.transfer(msg.sender, stakes);
        emit Unstaked(msg.sender, stakes);
    }

    function harvest() public {
        require(_stakes[msg.sender] > 0, "You haven't staked anything");
        uint256 earnedCookies = (_stakes[msg.sender]/10**18) * (1000 + _cookiePower[msg.sender]) * ((block.timestamp - _stakeStartTimes[msg.sender]) / 3600);
        _stakeStartTimes[msg.sender] = block.timestamp;
        _mint(msg.sender, earnedCookies * (10**18));
        emit Harvest(msg.sender, earnedCookies);
    }

    function eatCookies(uint256 amount) public {
        require(balanceOf(msg.sender) >= amount, "Not enough Cookies");
        require(amount >= 10**18, "You need to eat at least 1 entire cookie");
        _burn(msg.sender, amount);
        _cookiePower[msg.sender] += amount/100;
        emit EatCookies(msg.sender, amount);
    }
}
